import axios from "axios"

export default class BuscaBD {

    async BuscaBDPostAnuncio(imagens, dados) {
        const resultado = await axios.post("http://localhost:9000/cadastraveiculo", {
            data: dados
        },
            imagens

        )

        return resultado
    }


}
